-- Init database
DROP DATABASE IF EXISTS recipe_site;
CREATE DATABASE recipe_site;
USE recipe_site;
-- Drop tables if necessary
DROP TABLE IF EXISTS recipes;
DROP TABLE IF EXISTS accounts;
-- Create accounts table
CREATE TABLE accounts (
    account_id INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    email VARCHAR
(255) UNIQUE NOT NULL,
    password VARCHAR
(255) NOT NULL
) ENGINE = InnoDB CHARSET = utf8;
-- Create recipes table
CREATE TABLE recipes
(
    recipe_id INT NOT NULL
    AUTO_INCREMENT PRIMARY KEY,
    account_id INT NOT NULL,
    image LONGBLOB NOT NULL,
    name VARCHAR
    (255) NOT NULL,
    alt VARCHAR
    (255) NOT NULL,
    subtitle VARCHAR
    (255) NOT NULL,
    ingredients VARCHAR
    (1000) NOT NULL,
    method VARCHAR
    (1000) NOT NULL,
    CONSTRAINT fk_recipes_accounts FOREIGN KEY
    (account_id) REFERENCES accounts
    (account_id) 
    ON
    DELETE CASCADE 
    ON
    UPDATE CASCADE ) ENGINE = InnoDB;


INSERT INTO `recipes` (`account_id`, `image`, `name`, `alt`, `subtitle`, `ingredients`, `method`) VALUES
(1, , 'Noodles', 'Noodles', 'An easy recipe', '1 pack of noodles\r\n1 cup of water\r\n1 Other thing too', 'Empty the packet of noodles and the seasoning into a saucepan.\r\nPour the water into the saucepan as well.\r\nBring the water to the boil and cook until there is a small ammount of water left.\r\nLower the temperature then cook the noodles for another minute before moving the noodles to a serving bowl.\r\nEat the noodles.');
INSERT INTO `recipes` (`account_id`, `image`, `name`, `alt`, `subtitle`, `ingredients`, `method`) VALUES
(1, , 'Plain Rice', 'Plain rice in hands', 'Plain rice made the absorbtion way.', '1 cup of rice\r\n1 1/2 cups of water\r\nA pinch of salt', 'Wash the rice twice in cold water then strain and empty into a pot.\r\nTip the water into the same pot and add the salt.\r\nCook the rice over a medium heat for about 10 minutes.\r\nOnce the water is almost completely absorbed, put the lid on and reduce the heat to low for about a minute then turn the heat off. Listen for a crackling sound to know when to put the lid on.\r\nLeave the rice with the lid on and the heat off for about 10 minutes then it will be done. Don\'t take the lid off during this step.');
INSERT INTO `recipes` (`account_id`, `image`, `name`, `alt`, `subtitle`, `ingredients`, `method`) VALUES
(1, , 'Pasta with Sauce', 'Pasta with Sauce', 'It\'s like pasta but it has sauce on it.', '500g of pasta\r\n10L of water\r\nA handful of salt\r\n1 jar of pasta sauce', 'Put a handful of salt into the water and bring the water to the boil in a large pot.\r\nOnce the water is boiling, stir it then put the whole pack of pasta into the water.\r\nCook the pasta for about 10 minutes or however long it says on the pack.\r\nOnce it is cooked strain the pasta and put the pot back on the heat.\r\nEmpty the jar of sauce into the pot and cook on a medium heat until it is hot.\r\nMix the pasta into the sauce then eat it, probably from a bowl but that\'s not completely necessary.');
COMMIT;
